import React, { Fragment } from "react";

const About = () => {
  return (
    <Fragment>
      <h1>About This App</h1>
      <p className="my-1">This is full stack React app for keeping contacts</p>
      <p className="bg-dark p">
        <strong>Version : 1.0.0</strong>
      </p>
    </Fragment>
  );
};

export default About;
